import {Route} from "react-router-dom";
import PizzaOrderContainer from "../PizzaOrder/PizzaOrderContainer";
import AllProfile from "./AlllProfile/AllProfile";

const Profile = () => {
    return (
        <div>
            <Route path="/profile/pizza" render={() => <AllProfile/>
            }/>

            <Route path="pizza/:id" render={() => <PizzaOrderContainer
            />}/>
        </div>
    )
}
export default Profile
